import { format } from "date-fns";
import { ColumnFilter } from "./columnFilter";
import { Link } from "react-router-dom";

export const COLUMNS = [
  {
    Header: "Id",
    accessor: "props.appointments.id",
    disableFilters: true,
  },
  {
    Header: "Date",
    accessor: "props.appointments.date",
    Cell: ({ value }) => {
      return format(new Date(value), "dd/MM/yyyy");
    },
  },
  {
    Header: "Duration",
    accessor: "props.appointments.duration",
  },
  {
    Header: "Price",
    accessor: "props.appointments.price",
  },
];
